    "Assessment of aquatic toxicity in irrigation drainwater, Newlands Project Area
    Carson Desert, Nevada, March-August 1995",nt"tracking_summary": {ntt"total":
    5,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:24:59.415659",nt"name": "assessment-of-aquatic-toxicity-in-irrigation-drainwater-newlands-project-area-carson-deser",nt"isopen":
    false,nt"url": null,nt"notes": "The Nevada Fish and Wildlife Office of
    the U.S. Fish and Wildlife Service, in cooperation with the U.S. Department of Interior
    National Irrigation Water Quality Program, investigated the aquatic toxicity of
    water in irrigation drains in the Newlands Project area near Fallon, Nevada in 1995.
    The purposes of this report were to: 1) investigate the degree of seasonal variability
    and its effects on the quality of irrigation drainage in the Newlands Project near
    Fallon, Nevada; 2) identify source areas of the Newlands Project where irrigation
    drainage contributes most to aquatic toxicity in Lahontan Valley; and 3) identify
    specific water quality parameters that contribute to toxicity of aquatic biota.
    Water samples were collected from a number of drains during March, May, and August
    1995 in the Lahontan Valley for trace element residue analysis and toxicity testing.
    Samples collected in August 1995 were also analyzed for the presence of a variety
    of pesticides commonly used in the Lahontan Valley. Water samples were used in two
    types of bioassay tests. Constituent concentrations and bioassay test results were
    used to fulfill the above purposes.",nt"license_title": "License Not Specified",nt"extras":
